import React, { useState, useEffect } from 'react'

export default function DisplayArticle(props){
    function DisplayArticles(a){
        console.log(a)
        if (props.article.length > 0){
            props.article.map((a,b) => {
                return(
                    <div className="a">
                        <h2 className="">{a}</h2>
                        <h2 className="">{b}</h2>
                    </div>
                )
            })
        }
    }
    DisplayArticles(props.article.length)
    return <h1>1</h1>
}
